import "./index.css";
import { BrowserRouter as Router, Routes, Route, Navigate, useLocation } from "react-router-dom";
import { useState } from "react";

import Sidebar from "./components/Sidebar";
import Navbar from "./components/Navbar";
import ClientList from "./components/ClientList";
import NewClientForm from "./components/NewClientForm";
import ClientDetail from "./components/ClientDetail";
import PropertiesList from "./components/PropertyList";
import PropertyDetail from "./components/PropertyDetail";
import ClientPropEngine from "./components/ClientPropEngine";
import ActivitiesList from "./components/ActivitiesList";
import Informes from "./components/Informes";
import Marketing from "./components/Marketing";
import Questionaries from "./components/Questionaries";
import CreateInstanceSelector from "./components/CreateInstanceSelector";
import Calendar from "./components/Calendar";
import UserPanel from "./components/UserPanel";
import NewEdificioForm from "./components/NewEdificioForm";
import NewInmuebleForm from "./components/NewInmuebleForm";
import PedidoList from "./components/PedidoList";
import PedidoDetail from "./components/PedidoDetail";
import LoginPage from "./components/Login";
import ProtectedRoute from "./components/ProtectedRoute";

import { AuthProvider } from "./context/AuthContext";

function Layout() {
  const [sidebarVisible, setSidebarVisible] = useState(true);
  const toggleSidebar = () => setSidebarVisible((prev) => !prev);

  const location = useLocation();
  const hideLayout = location.pathname === "/login";

  return (
    <div className="flex h-screen flex-col bg-white">
      {/* Navbar visible solo si no estamos en Login */}
      {!hideLayout && <Navbar toggleSidebar={toggleSidebar} />}

      <div className="flex flex-1">
        {/* Sidebar visible solo si no estamos en Login */}
        {!hideLayout && <Sidebar isVisible={sidebarVisible} />}

        <div
          className={`flex-1 transition-all duration-300 ${
            hideLayout
              ? "p-0 flex items-center justify-center" // centra login
              : `p-6 overflow-auto ${sidebarVisible ? "ml-[10%]" : ""}`
          }`}
        >
          <Routes>
            {/* PUBLIC ROUTE */}
            <Route path="/login" element={<LoginPage />} />

            {/* PROTECTED ROUTES */}
            <Route
              path="/clientes"
              element={
                <ProtectedRoute>
                  <ClientList />
                </ProtectedRoute>
              }
            />
            <Route
              path="/clientes/nuevo"
              element={
                <ProtectedRoute>
                  <NewClientForm />
                </ProtectedRoute>
              }
            />
            <Route
              path="/clientes/:id"
              element={
                <ProtectedRoute>
                  <ClientDetail />
                </ProtectedRoute>
              }
            />
            <Route
              path="/inmuebles"
              element={
                <ProtectedRoute>
                  <PropertiesList />
                </ProtectedRoute>
              }
            />
            <Route
              path="/inmuebles/:id"
              element={
                <ProtectedRoute>
                  <PropertyDetail />
                </ProtectedRoute>
              }
            />
            <Route
              path="/solicitudes"
              element={
                <ProtectedRoute>
                  <PedidoList />
                </ProtectedRoute>
              }
            />
            <Route
              path="/solicitudes/:id"
              element={
                <ProtectedRoute>
                  <PedidoDetail />
                </ProtectedRoute>
              }
            />
            <Route
              path="/motor-cruce"
              element={
                <ProtectedRoute>
                  <ClientPropEngine />
                </ProtectedRoute>
              }
            />
            <Route
              path="/actividades"
              element={
                <ProtectedRoute>
                  <ActivitiesList />
                </ProtectedRoute>
              }
            />
            <Route
              path="/informes"
              element={
                <ProtectedRoute>
                  <Informes />
                </ProtectedRoute>
              }
            />
            <Route
              path="/marketing"
              element={
                <ProtectedRoute>
                  <Marketing />
                </ProtectedRoute>
              }
            />
            <Route
              path="/cuestionarios"
              element={
                <ProtectedRoute>
                  <Questionaries />
                </ProtectedRoute>
              }
            />
            <Route
              path="/crear"
              element={
                <ProtectedRoute>
                  <CreateInstanceSelector />
                </ProtectedRoute>
              }
            />
            <Route
              path="/agenda"
              element={
                <ProtectedRoute>
                  <Calendar />
                </ProtectedRoute>
              }
            />
            <Route
              path="/usuario"
              element={
                <ProtectedRoute>
                  <UserPanel />
                </ProtectedRoute>
              }
            />
            <Route
              path="/edificios/nuevo"
              element={
                <ProtectedRoute>
                  <NewEdificioForm />
                </ProtectedRoute>
              }
            />
            <Route
              path="/inmuebles/nuevo"
              element={
                <ProtectedRoute>
                  <NewInmuebleForm />
                </ProtectedRoute>
              }
            />

            {/* DEFAULT */}
            <Route path="*" element={<Navigate to="/login" replace />} />
          </Routes>
        </div>
      </div>
    </div>
  );
}

export default function App() {
  return (
    <AuthProvider>
      <Router>
        <Layout />
      </Router>
    </AuthProvider>
  );
}
